import Form from './components/Form'
import Schedule from './components/Schedule'
import generateSchedules from './generateSchedules'


const App = () => {

  const [sections, setSections] = useState([])
  const [term, setTerm] = useState("202320")
  const [userSections, setUserSections] = useState([])

  useEffect(() => {
    bannerService.classSearch(202320, 'ISCO')
      .then(sec => setSections(sec.data.data))
  }, [])

  return(
    <div className='par'>
      <Nav className='nav'/>
      <div className='main'>
        <Form className='form-app' term={term} setTerm={setTerm} />
        <Schedule className='schedule-app'/>
      </div>
    </div>)
}

export default App;
